import { Link } from "react-router-dom";
import "../css/Home.css";

function Home() {
	return (
		<div id="main">
			<img
				src="/whiteCat.png"
				alt="Cloudy the Cat"
			/>
			<img
				class="fit-picture"
				src="/media/cc0-images/grapefruit-slice-332-332.jpg"
				alt="Grapefruit slice atop a pile of other slices"
			/>
			<h1>Home</h1>
			<nav>
				<Link to="todo">Todo</Link>
			</nav>
		</div>
	);
}

export default Home;
